import React, { Component } from 'react';
import Fade from 'react-reveal/Fade';

class Footer extends Component {
  render() {
    return (
      <Fade up duration={3000}>
        <p style={{paddingTop:'30px'}}>
          <h3 className="left">Contact me at</h3>
        </p> 
      </Fade>
    );
  }
}

export default Footer;
